import React from 'react'
import ListItem from "./ListItem";

export default function ChatList({listItems, user}) {
    return (
        <div className={"chatList"}>
            {
                listItems && listItems.map(item => {
                    return <ListItem item={item} user={user}/>
                })
            }
        </div>
    )
}
